-- ----------------------------
-- Table structure for area
-- ----------------------------
DROP TABLE IF EXISTS `area`;
CREATE TABLE `area` (
  `area_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT COMMENT '地区Id',
  `parent_id` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '地区父节点',
  `area_code` varchar(50) NOT NULL COMMENT '地区编码',
  `w_code` char(10) NOT NULL DEFAULT '' COMMENT '天气编码',
  `area_name` varchar(20) NOT NULL COMMENT '地区名',
  `level` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '地区级别（1:省份province,2:市city,3:区县district,4:街道street）',
  `city_code` varchar(50) DEFAULT '' COMMENT '城市编码',
  `center` varchar(50) DEFAULT '' COMMENT '城市中心点（即：经纬度坐标）',
  `py` varchar(30) NOT NULL DEFAULT '' COMMENT '简拼',
  `pinyin` varchar(100) NOT NULL DEFAULT '' COMMENT '全拼',
  PRIMARY KEY (`area_id`),
  KEY `parentid` (`parent_id`),
  KEY `level` (`level`),
  KEY `areacode` (`area_code`)
) ENGINE=MyISAM AUTO_INCREMENT=3260 DEFAULT CHARSET=utf8mb4 COMMENT='地区码表';

