-- ----------------------------
-- Table structure for banner
-- ----------------------------
DROP TABLE IF EXISTS `banner`;
CREATE TABLE `banner` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '广告ID',
  `banner_name` varchar(80) NOT NULL COMMENT '广告名称',
  `banner_type` tinyint(1) unsigned NOT NULL COMMENT '广告类型：1是全国招商；2是区域招商',
  `banner_sort` int(5) unsigned NOT NULL COMMENT '排序',
  `banner_link` varchar(255) DEFAULT NULL COMMENT '连接项目',
  `banner_image` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '图片地址',
  `banner_status` tinyint(1) unsigned DEFAULT NULL COMMENT '状态：1是已启用；2是已禁用',
  `address_ids` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '地址ID',
  `created_at` int(11) DEFAULT '0' COMMENT '添加时间',
  `updated_at` int(11) unsigned DEFAULT '0' COMMENT '更新时间',
  `deleted_at` int(11) unsigned DEFAULT '0' COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COMMENT='广告表';

